import MasterPage from '../components/MasterPage';
import fetch from 'isomorphic-unfetch';
import axios from 'axios';


const Index = (props) => (
    <MasterPage>
        {/* Todo lo que este acá dentro es el {props.children} de MasterPage */}
        <div className="row">
            <div className="col-12">
                <h2>Precio del Bitcoin</h2>
                {console.log(props.resultado)}
            </div>

            <div className="col-md-8">
                <h2>Noticias sobre el Bitcoin</h2>
            </div>

            <div className="col-md-4">
                <h2>Proximos eventos del Bitcoin</h2>
            </div>
        </div>
    </MasterPage>
)

Index.getInitialProps = async () => {
    try{
        const precio = await fetch('https://min-api.cryptocompare.com/data/pricemultifull?fsyms=BTC&tsyms=USD&api_key=f1edaeb4aa907915e6d2d70b828b1c4a12430b53e8c060cf649e6851fc90bd59')
        const resPrecio =  precio.json();
        return {
            resultado : resPrecio
        }
    }catch(e){
        console.log(e);
    }

};

export default Index;
